	"sap/fe/plugins/managecache/comp/i18n/messagebundle_en_US_saptrc.properties":'title=3z2dToWqTE4HL8dIdJWyXg_Clear Batch Cache\ndescription=V2hqruR9U2fnuhW67yEyHg_Request Batch Setting\nT_GROUP=pXrBPIuTgUnZi0dt0rq+YQ_User Activities\nT_CACHE_INFORMATION_MSG=eouuBUCN7qKblFmjatu/tw_Define the expiration in days of the batch cache on the browser side.\\nThis cache will be used to optimize opening of the application.\\n\\nOnly requested parameters not marked as sensitive are stored in this cache, and no query results are stored.\\nThis means that no sensitive data is stored in this cache.\\n\\nIt is recommended to set the expiration between 0 and 360 days.\\nYou can clear the cache by pressing the Clear Batch Cache button.\nT_EXPIRY=88ZJLglof9stWxdSCvugzQ_Expiration\\:\nT_DAYS=Naw7iW671KrCubMFMJ7uRA_Days\nB_CLEANUP_CACHE=WWyd1ECHYII0mG0HPgIz2A_Clear Batch Cache\nM_CLEANUP_SUCCESS=RLTDE28zIdvXTJtt/2NhGA_Request cache was cleared successfully\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_es.properties":'title=Borrar cach\\u00E9 por lotes\ndescription=Solicitar opciones por lote\nT_GROUP=Actividades del usuario\nT_CACHE_INFORMATION_MSG=Defina el vencimiento en d\\u00EDas de la cach\\u00E9 por lotes en el lado del navegador.\\nEsta cach\\u00E9 se utilizar\\u00E1 para optimizar la apertura de la aplicaci\\u00F3n.\\n\\nEn esta cach\\u00E9 solo se almacenan los par\\u00E1metros solicitados que no est\\u00E1n marcados como confidenciales, y no se almacena ning\\u00FAn resultado de consulta.\\nEsto significa que en esta cach\\u00E9 no se almacenan datos confidenciales.\\n\\nSe recomienda establecer el vencimiento entre 0 y 360 d\\u00EDas.\\nPuede borrar la cach\\u00E9 presionando el bot\\u00F3n Borrar cach\\u00E9 por lotes.\nT_EXPIRY=Caducidad\\:\nT_DAYS=D\\u00EDas\nB_CLEANUP_CACHE=Borrar cach\\u00E9 por lotes\nM_CLEANUP_SUCCESS=La cach\\u00E9 de solicitudes se ha borrado correctamente\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_es_MX.properties":'title=Borrar cach\\u00E9 por lotes\ndescription=Solicitar configuraci\\u00F3n por lotes\nT_GROUP=Actividades de usuario\nT_CACHE_INFORMATION_MSG=Defina el vencimiento en d\\u00EDas de la cach\\u00E9 por lotes en el lado del navegador.\\nEsta cach\\u00E9 se utilizar\\u00E1 para optimizar la apertura de la aplicaci\\u00F3n.\\n\\nEn esta cach\\u00E9 solo se almacenan los par\\u00E1metros solicitados que no est\\u00E1n marcados como confidenciales, y no se almacena ning\\u00FAn resultado de consulta.\\nEsto significa que en esta cach\\u00E9 no se almacenan datos confidenciales.\\n\\nSe recomienda establecer el vencimiento entre 0 y 360 d\\u00EDas.\\nPuede borrar la cach\\u00E9 presionando el bot\\u00F3n Borrar cach\\u00E9 por lotes.\nT_EXPIRY=Vencimiento\\:\nT_DAYS=D\\u00EDas\nB_CLEANUP_CACHE=Borrar cach\\u00E9 por lotes\nM_CLEANUP_SUCCESS=La cach\\u00E9 de solicitudes se borr\\u00F3 correctamente\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_et.properties":'title=T\\u00FChjenda partii vahem\\u00E4lu\ndescription=Taotle partii s\\u00E4tet\nT_GROUP=Kasutaja tegevused\nT_CACHE_INFORMATION_MSG=M\\u00E4\\u00E4ratlege partii vahem\\u00E4lu aegumine p\\u00E4evades brauseri poolel.\\nSeda vahem\\u00E4lu kasutatakse rakenduse avamise optimeerimiseks.\\n\\nSellesse vahem\\u00E4llu salvestatakse ainult taotletud parameetrid, mida pole m\\u00E4rgitud tundlikuks, ja p\\u00E4ringutulemusi ei salvestata.\\nSee t\\u00E4hendab, et tundlikke andmeid sellesse vahem\\u00E4llu ei salvestata.\\n\\nSoovitatav on m\\u00E4\\u00E4rata aegumisperioodiks 0\\u2013360 p\\u00E4eva.\\nSaate vahem\\u00E4lu t\\u00FChjendada, kui vajutate nuppu T\\u00FChjenda partii vahem\\u00E4lu.\nT_EXPIRY=Aegumine\\:\nT_DAYS=P\\u00E4evad\nB_CLEANUP_CACHE=T\\u00FChjenda partii vahem\\u00E4lu\nM_CLEANUP_SUCCESS=Taotluse vahem\\u00E4lu on t\\u00FChjendatud\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_fi.properties":'title=Tyhjenn\\u00E4 v\\u00E4limuisti\ndescription=Pyyd\\u00E4 er\\u00E4asetus\nT_GROUP=K\\u00E4ytt\\u00E4j\\u00E4n toiminnot\nT_CACHE_INFORMATION_MSG=M\\u00E4\\u00E4rit\\u00E4 vanheneminen p\\u00E4ivin\\u00E4 er\\u00E4v\\u00E4limuistin selaimen puolella. T\\u00E4t\\u00E4 v\\u00E4limuistia k\\u00E4ytet\\u00E4\\u00E4n sovelluksen avaamisen optimointiin.\\n\\nVain pyydetyt parametrit, joita ei ole merkitty arkaluonteisiksi, tallennetaan v\\u00E4limuistiin, eik\\u00E4 kyselytuloksia tallenneta.\\nT\\u00E4m\\u00E4 tarkoittaa, ett\\u00E4 arkaluonteista tietoa ei tallenneta t\\u00E4h\\u00E4n v\\u00E4limuistiin.\\n\\nOn suositeltavaa m\\u00E4\\u00E4ritt\\u00E4\\u00E4 vanhenemisaika 0 ja 360 p\\u00E4iv\\u00E4n v\\u00E4lille.\\nVoit tyhjent\\u00E4\\u00E4 v\\u00E4limuistin painamalla Tyhjenn\\u00E4 er\\u00E4v\\u00E4limuisti -painiketta.\nT_EXPIRY=Er\\u00E4\\u00E4ntyminen\\:\nT_DAYS=P\\u00E4iv\\u00E4t\nB_CLEANUP_CACHE=Tyhjenn\\u00E4 v\\u00E4limuisti\nM_CLEANUP_SUCCESS=Pyynt\\u00F6v\\u00E4limuisti tyhjennettiin onnistuneesti\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_fr.properties":'title=R\\u00E9initialiser la m\\u00E9moire cache du lot\ndescription=Param\\u00E8tre de lot de demande\nT_GROUP=Activit\\u00E9s utilisateur\nT_CACHE_INFORMATION_MSG=D\\u00E9finit le d\\u00E9lai d\'expiration, exprim\\u00E9 en jours, pour la m\\u00E9moire cache du lot c\\u00F4t\\u00E9 navigateur.\\nCette m\\u00E9moire cache est utilis\\u00E9e pour optimiser l\'ouverture de l\'application.\\n\\nSeuls les param\\u00E8tres demand\\u00E9s non marqu\\u00E9s comme sensibles sont enregistr\\u00E9s dans cette m\\u00E9moire cache et aucun r\\u00E9sultat de requ\\u00EAte n\'est enregistr\\u00E9.\\nCela signifie qu\'aucune donn\\u00E9e sensible n\'est enregistr\\u00E9e dans cette m\\u00E9moire cache.\\n\\nSAP recommande de d\\u00E9finir un d\\u00E9lai d\'expiration compris entre 0 et 360\\u00A0jours.\\nVous pouvez vider la m\\u00E9moire cache en cliquant sur le bouton R\\u00E9initialiser la m\\u00E9moire cache du lot.\nT_EXPIRY=Expiration \\:\nT_DAYS=Jours\nB_CLEANUP_CACHE=R\\u00E9initialiser la m\\u00E9moire cache du lot\nM_CLEANUP_SUCCESS=La r\\u00E9initialisation de la m\\u00E9moire cache de demande a r\\u00E9ussi.\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_fr_CA.properties":'title=R\\u00E9initialiser la m\\u00E9moire cache du lot\ndescription=Param\\u00E8tre de lot de demande\nT_GROUP=Activit\\u00E9s utilisateur\nT_CACHE_INFORMATION_MSG=D\\u00E9finit le d\\u00E9lai d\'expiration (en jours) pour la m\\u00E9moire cache du lot c\\u00F4t\\u00E9 navigateur.\\nLa m\\u00E9moire cache est utilis\\u00E9e pour optimiser l\'ouverture de l\'application.\\n\\nSeuls les param\\u00E8tres demand\\u00E9s non marqu\\u00E9s comme sensibles sont enregistr\\u00E9s dans la m\\u00E9moire cache. Aucun r\\u00E9sultat de requ\\u00EAte n\'est enregistr\\u00E9.\\nPar cons\\u00E9quent, aucune donn\\u00E9e sensible n\'est enregistr\\u00E9e dans la m\\u00E9moire cache.\\n\\nSAP recommande de d\\u00E9finir un d\\u00E9lai d\'expiration compris entre 0 et 360\\u00A0jours.\\nVous pouvez vider la m\\u00E9moire cache en cliquant sur le bouton R\\u00E9initialiser la m\\u00E9moire cache du lot.\nT_EXPIRY=Expiration\\:\nT_DAYS=Jours\nB_CLEANUP_CACHE=R\\u00E9initialiser la m\\u00E9moire cache du lot\nM_CLEANUP_SUCCESS=La r\\u00E9initialisation de la m\\u00E9moire cache de demande a r\\u00E9ussi.\n',
