	"sap/fe/plugins/managecache/comp/i18n/messagebundle_hr.properties":'title=Poni\\u0161ti cache serije\ndescription=Zatra\\u017Ei postavu serije\nT_GROUP=Aktivnosti korisnika\nT_CACHE_INFORMATION_MSG=Definirajte istek u danima za cache serije na strani preglednika.\\nTaj cache upotrijebit \\u0107e se za optimiziranje otvaranja aplikacije.\\n\\nU ovaj cache pohranjuju se samo zatra\\u017Eeni parametri koji nisu ozna\\u010Deni kao osjetljivi, a rezultati upita ne pohranjuju se.\\nTo zna\\u010Di da se u ovaj cache ne pohranjuju nikakvi osjetljivi podaci.\\n\\nPreporu\\u010Duje se postaviti istek na izme\\u0111u 0 i 360 dana.\\nCache mo\\u017Eete poni\\u0161titi pritiskom na gumb Poni\\u0161ti cache serije.\nT_EXPIRY=Istek\\:\nT_DAYS=Dani\nB_CLEANUP_CACHE=Poni\\u0161ti cache serije\nM_CLEANUP_SUCCESS=Cache zahtjeva uspje\\u0161no je poni\\u0161ten\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_hu.properties":'title=K\\u00F6tegcache \\u00FCr\\u00EDt\\u00E9se\ndescription=K\\u00E9relemk\\u00F6teg-be\\u00E1ll\\u00EDt\\u00E1s\nT_GROUP=Felhaszn\\u00E1l\\u00F3i tev\\u00E9kenys\\u00E9gek\nT_CACHE_INFORMATION_MSG=Adja meg a k\\u00F6tegcache b\\u00F6ng\\u00E9sz\\u0151oldali lej\\u00E1rati idej\\u00E9t napban.\\nA cache az alkalmaz\\u00E1s megnyit\\u00E1s\\u00E1nak optimaliz\\u00E1l\\u00E1s\\u00E1ra haszn\\u00E1latos.\\n\\nCsak a bizalmask\\u00E9nt nem megjel\\u00F6lt param\\u00E9terek t\\u00E1rol\\u00F3dnak ebben a cache-ben, \\u00E9s a queryeredm\\u00E9nyeket nem t\\u00E1rolja.\\nVagyis semmilyen bizalmas adatot nem t\\u00E1rol a cache.\\n\\nJavasoljuk, hogy 0 \\u00E9s 360 nap k\\u00F6z\\u00F6tti lej\\u00E1ratot \\u00E1ll\\u00EDtson be.\\nA cache ki\\u00FCr\\u00EDt\\u00E9s\\u00E9hez kattintson a K\\u00F6tegcache \\u00FCr\\u00EDt\\u00E9se gombra.\nT_EXPIRY=Lej\\u00E1rat\\:\nT_DAYS=nap\nB_CLEANUP_CACHE=K\\u00F6tegcache \\u00FCr\\u00EDt\\u00E9se\nM_CLEANUP_SUCCESS=A k\\u00E9relemcache sikeresen ki\\u00FCr\\u00EDtve\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_id.properties":'title=Hapus Cache Batch\ndescription=Minta Pengaturan Batch\nT_GROUP=Aktivitas Pengguna\nT_CACHE_INFORMATION_MSG=Tentukan masa kedaluwarsa dalam hari dari cache batch pada sisi browser.\\nCache ini akan digunakan untuk mengoptimalkan pembukaan aplikasi.\\n\\nHanya parameter yang diminta dan tidak ditandai sebagai sensitif yang disimpan dalam cache ini, dan hasil kueri tidak ada yang disimpan.\\nIni berarti bahwa tidak ada data sensitif yang disimpan dalam cache ini.\\n\\nSebaiknya, masa kedaluwarsa diatur antara 0 hingga 360 hari.\\nAnda dapat menghapus cache dengan menekan tombol Hapus Cache Batch.\nT_EXPIRY=Kedaluwarsa\\:\nT_DAYS=Hari\nB_CLEANUP_CACHE=Hapus Cache Batch\nM_CLEANUP_SUCCESS=Cache permintaan berhasil dihapus\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_it.properties":'title=Cancella cache batch\ndescription=Impostazioni batch richiesta\nT_GROUP=Attivit\\u00E0 utente\nT_CACHE_INFORMATION_MSG=Definire la scadenza della cache batch in giorni sul lato server.\\nQuesta cache verr\\u00E0 utilizzata per ottimizzare l\'apertura dell\'applicazione.\\n\\nIn questa cache vengono memorizzati solo i parametri obbligatori non contrassegnati come sensibili, non i risultati delle query.\\nQuesto significa che in questa cache non vengono memorizzati dati sensibili.\\n\\nSi consiglia di impostare la scadenza tra 0 e 360 giorni.\\n\\u00C8 possibile svuotare la cache premendo il pulsante Cancella cache batch.\nT_EXPIRY=Scadenza\\:\nT_DAYS=Giorni\nB_CLEANUP_CACHE=Cancella cache batch\nM_CLEANUP_SUCCESS=Cache richieste cancellata correttamente\n',
