	"sap/fe/plugins/managecache/comp/i18n/messagebundle_ms.properties":'title=Kosongkan Cache Kelompok\ndescription=Tetapan Kolompok Permintaan\nT_GROUP=Aktiviti Pengguna\nT_CACHE_INFORMATION_MSG=Takrifkan tamat tempoh dalam hari bagi cache kelompok pada bahagian pelayar.\\nCache ini akan digunakan untuk mengoptimumkan pembukaan aplikasi.\\n\\nHanya parameter yang diminta tidak ditanda sebagai sensitif akan disimpan dalam cache ini dan tiada hasil pertanyaan akan disimpan.\\nIni bermakna bahawa tiada data sensitif yang akan disimpan dalam cache ini.\\n\\nKami mencadangkan anda menetapkan tamat tempoh antara 0 dan 360 hari.\\nAnda boleh mengosongkan cache tersebut dengan menekan butang Kosongkan Cache Kelompok.\nT_EXPIRY=Tamat Tempoh\\:\nT_DAYS=Hari\nB_CLEANUP_CACHE=Kosongkan Cache Kelompok\nM_CLEANUP_SUCCESS=Cache permintaan berjaya dikosongkan\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_nl.properties":'title=Batchcache wissen\ndescription=Batchinstelling aanvragen\nT_GROUP=Gebruikersactiviteiten\nT_CACHE_INFORMATION_MSG=Definieer de vervaltijd in dagen van de batchcache aan de kant van de browser.\\nDeze cache wordt gebruikt om het openen van de applicatie te optimaliseren.\\n\\nAlleen aangevraagde parameters die niet als gevoelig zijn gemarkeerd worden in deze cache opgeslagen. Er worden geen queryresultaten opgeslagen. Deze cache zal dus geen gevoelige gegevens bevatten.\\n\\nHet wordt aanbevolen een vervaltijd tussen 0 en 360 in te stallen.\\nDe cache kan worden gewist via de knop Batchcache wissen.\nT_EXPIRY=Vervalt over\\:\nT_DAYS=Dagen\nB_CLEANUP_CACHE=Batchcache wissen\nM_CLEANUP_SUCCESS=Aanvraagcache gewist\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_no.properties":'title=T\\u00F8m cache for batch\ndescription=Batchinnstilling for foresp\\u00F8rsel\nT_GROUP=Brukeraktiviteter\nT_CACHE_INFORMATION_MSG=Definer utl\\u00F8p i dager for cache for batch p\\u00E5 nettlesersiden.\\nDenne cachen brukes til \\u00E5 optimere \\u00E5pningen av applikasjonen.\\n\\nBare forespurte parametere, som ikke er merket som sensitive, lagres i denne cachen og ingen sp\\u00F8rringsresultater lagres.\\nDette betyr at sensitive data ikke lagres i denne cachen.\\n\\nDet anbefales \\u00E5 sette utl\\u00F8psdato p\\u00E5 mellom 0 og 360 dager.\\nDu kan t\\u00F8mme cache ved \\u00E5 trykke p\\u00E5 knappen T\\u00F8m cache for batch.\nT_EXPIRY=Utl\\u00F8p\\:\nT_DAYS=Dager\nB_CLEANUP_CACHE=T\\u00F8m cache for batch\nM_CLEANUP_SUCCESS=Foresp\\u00F8rselscache er t\\u00F8mt\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_pl.properties":'title=Czyszczenie pami\\u0119ci podr\\u0119cznej wsadowej\ndescription=Ustawienia pami\\u0119ci podr\\u0119cznej dla \\u017C\\u0105dania\nT_GROUP=Dzia\\u0142ania u\\u017Cytkownika\nT_CACHE_INFORMATION_MSG=Okre\\u015Bla czas wyga\\u015Bni\\u0119cia pami\\u0119ci podr\\u0119cznej wsadowej po stronie przegl\\u0105darki w dniach.\\nTa pami\\u0119\\u0107 podr\\u0119czna b\\u0119dzie u\\u017Cywana do optymalizacji otwierania aplikacji.\\n\\nW tej pami\\u0119ci podr\\u0119cznej przechowywane s\\u0105 tylko \\u017C\\u0105dane parametry, kt\\u00F3re nie s\\u0105 oznaczone jako wra\\u017Cliwe, i nie s\\u0105 przechowywane \\u017Cadne wyniki zapyta\\u0144.\\nOznacza to, \\u017Ce w tej pami\\u0119ci podr\\u0119cznej nie s\\u0105 przechowywane \\u017Cadne wra\\u017Cliwe dane.\\n\\nZaleca si\\u0119 ustawienie czasu wyga\\u015Bni\\u0119cia w zakresie od 0 do 360 dni.\\nPami\\u0119\\u0107 podr\\u0119czn\\u0105 mo\\u017Cna wyczy\\u015Bci\\u0107, naciskaj\\u0105c przycisk Wyczy\\u015B\\u0107 pami\\u0119\\u0107 podr\\u0119czn\\u0105 wsadow\\u0105.\nT_EXPIRY=Wyga\\u015Bni\\u0119cie\\:\nT_DAYS=Dni\nB_CLEANUP_CACHE=Wyczy\\u015B\\u0107 pami\\u0119\\u0107 podr\\u0119czn\\u0105 wsadow\\u0105\nM_CLEANUP_SUCCESS=Pomy\\u015Blnie wyczyszczono pami\\u0119\\u0107 podr\\u0119czn\\u0105 dla \\u017C\\u0105dania\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_pt.properties":'title=Limpar cache em lote\ndescription=Solicitar configura\\u00E7\\u00E3o de lote\nT_GROUP=Atividades do usu\\u00E1rio\nT_CACHE_INFORMATION_MSG=Definir a expira\\u00E7\\u00E3o em dias do cache em lote no lado do browser.      \\nEste cache ser\\u00E1 utilizado para otimizar a abertura da aplica\\u00E7\\u00E3o.\\n\\nS\\u00F3 par\\u00E2metros pedidos n\\u00E3o marcados como confidenciais s\\u00E3o armazenados neste cache e nenhum resultado de pesquisa \\u00E9 armazenado.\\nIsso significa que n\\u00E3o s\\u00E3o armazenados dados confidenciais neste cache.\\n\\n\\u00C9 recomendado definir a expira\\u00E7\\u00E3o entre 0 e 360 dias.\\nPode limpar o cache pressionando o bot\\u00E3o Limpar cache em lote.\nT_EXPIRY=Vencimento\\:\nT_DAYS=Dias\nB_CLEANUP_CACHE=Limpar cache em lote\nM_CLEANUP_SUCCESS=O cache de solicita\\u00E7\\u00E3o foi limpo com \\u00EAxito\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_pt_PT.properties":'title=Limpar cache em lote\ndescription=Pedir defini\\u00E7\\u00E3o do lote\nT_GROUP=Atividades do utilizador\nT_CACHE_INFORMATION_MSG=Definir a expira\\u00E7\\u00E3o em dias da cache em lote no lado do browser.\\nEsta cache ser\\u00E1 utilizada para otimizar a abertura da aplica\\u00E7\\u00E3o.\\n\\nS\\u00F3 par\\u00E2metros pedidos n\\u00E3o marcados como confidenciais s\\u00E3o armazenados nesta cache e nenhum resultado de pesquisa \\u00E9 armazenado.\\nIsso significa que n\\u00E3o s\\u00E3o armazenados dados confidenciais nesta cache.\\n\\n\\u00C9 recomendado definir a expira\\u00E7\\u00E3o entre 0 e 360 dias.\\nPode limpar a cache pressionando o bot\\u00E3o Limpar cache em lote.\nT_EXPIRY=Expira\\u00E7\\u00E3o\\:\nT_DAYS=Dias\nB_CLEANUP_CACHE=Limpar cache em lote\nM_CLEANUP_SUCCESS=A cache de pedido foi limpa com sucesso\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_ro.properties":'title=Resetare cache batch\ndescription=Setare batch cerere\nT_GROUP=Activit\\u0103\\u021Bi utilizator\nT_CACHE_INFORMATION_MSG=Defini\\u021Bi expirarea \\u00EEn zile pentru cache lot pe partea de browser.\\nAcest cache va fi utilizat pentru a optimiza deschiderea aplica\\u021Biei.\\n\\nDoar parametrii solicita\\u021Bi nemarca\\u021Bi ca sensibili sunt stoca\\u021Bi \\u00EEn acest cache \\u0219i niciun rezultat de query nu este stocat.\\nAcest lucru \\u00EEnseamn\\u0103 c\\u0103 nu exist\\u0103 date sensibile stocate \\u00EEn acest cache.\\n\\nV\\u0103 recomand\\u0103m s\\u0103 seta\\u021Bi expirarea la \\u00EEntre 0 \\u0219i 360 de zile.\\nPute\\u021Bi reseta cache-ul ap\\u0103s\\u00E2nd butonul Resetare cache lot.\nT_EXPIRY=Expirare\\:\nT_DAYS=Zile\nB_CLEANUP_CACHE=Resetare cache batch\nM_CLEANUP_SUCCESS=Cache cerere a fost resetat cu succes\n',
