	"sap/fe/plugins/managecache/comp/i18n/messagebundle_sh.properties":'title=Obri\\u0161i ke\\u0161 memoriju grupe\ndescription=Zahtevaj pode\\u0161avanje grupe\nT_GROUP=Aktivnosti korisnika\nT_CACHE_INFORMATION_MSG=Defini\\u0161ite istek u danima ke\\u0161 memorije grupe na strani pregleda\\u010Da.\\nOva ke\\u0161 memorija \\u0107e biti kori\\u0161\\u0107ena da optimizira otvaranje aplikacije.\\n\\nSamo zahtevani parametri koji nisu ozna\\u010Deni kao osetljivi se arhiviraju u ovoj ke\\u0161 memoriji, a rezultati upita se ne arhiviraju.\\nTo zna\\u010Di da se osetljivi podaci ne arhiviraju u ovoj ke\\u0161 memoriji.\\n\\nPreporu\\u010Duje se da se postavi istek izme\\u0111u 0 i 360 dana.\\nMo\\u017Eete obrisati ke\\u0161 memoriju pritiskom na dugme Obri\\u0161i ke\\u0161 memoriju grupe.\nT_EXPIRY=Istek\\:\nT_DAYS=Dani\nB_CLEANUP_CACHE=Obri\\u0161i ke\\u0161 memoriju grupe\nM_CLEANUP_SUCCESS=Ke\\u0161 memorija zahteva je uspe\\u0161no izbrisana\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_sk.properties":'title=Vymaza\\u0165 vyrovn\\u00E1vaciu pam\\u00E4\\u0165 d\\u00E1vky\ndescription=Po\\u017Eiada\\u0165 o nastavenie d\\u00E1vky\nT_GROUP=Aktivity pou\\u017E\\u00EDvate\\u013Ea\nT_CACHE_INFORMATION_MSG=Definujte uplynutie platnosti v d\\u0148och d\\u00E1vkovej vyrovn\\u00E1vacej pam\\u00E4te na strane prehliada\\u010Da. T\\u00E1to vyrovn\\u00E1vacia pam\\u00E4\\u0165 sa pou\\u017Eije na optimaliz\\u00E1ciu otv\\u00E1rania aplik\\u00E1cie.\\nV tejto vyrovn\\u00E1vacej pam\\u00E4ti s\\u00FA ulo\\u017Een\\u00E9 iba po\\u017Eadovan\\u00E9 parametre, ktor\\u00E9 nie s\\u00FA ozna\\u010Den\\u00E9 ako citliv\\u00E9, a neukladaj\\u00FA sa \\u017Eiadne v\\u00FDsledky dotazov. To znamen\\u00E1, \\u017Ee v tejto vyrovn\\u00E1vacej pam\\u00E4ti nie s\\u00FA ulo\\u017Een\\u00E9 \\u017Eiadne citliv\\u00E9 \\u00FAdaje.\\n\\nOdpor\\u00FA\\u010Da sa nastavi\\u0165 exspir\\u00E1ciu medzi 0 a 360 d\\u0148ami. Vyrovn\\u00E1vaciu pam\\u00E4\\u0165 m\\u00F4\\u017Eete vymaza\\u0165 stla\\u010Den\\u00EDm tla\\u010Didla Vymaza\\u0165 vyrovn\\u00E1vaciu pam\\u00E4\\u0165 d\\u00E1vky.\nT_EXPIRY=Exspir\\u00E1cia\nT_DAYS=Dni\nB_CLEANUP_CACHE=Vymaza\\u0165 vyrovn\\u00E1vaciu pam\\u00E4\\u0165 d\\u00E1vky\nM_CLEANUP_SUCCESS=Vyrovn\\u00E1vacia pam\\u00E4\\u0165 po\\u017Eiadavky bola \\u00FAspe\\u0161ne vymazan\\u00E1\n',
	"sap/fe/plugins/managecache/comp/i18n/messagebundle_sl.properties":'title=Po\\u010Disti predpomnilnik paketov\ndescription=Nastavitev paketa zahtev\nT_GROUP=Aktivnosti uporabnika\nT_CACHE_INFORMATION_MSG=Dolo\\u010Dite \\u0161tevilo dni do poteka za predpomnilnik paketov v brskalniku.\\nTa predpomnilnik se bo uporabljal za optimiziranje odpiranja aplikacije.\\n\\nV tem predpomnilniku so shranjeni le zahtevani parametri, ki niso ozna\\u010Deni kot ob\\u010Dutljivi, rezultati poizvedb pa niso shranjeni. To pomeni, da ob\\u010Dutljivi podatki niso shranjeni v tem predpomnilniku.\\n\\nPriporo\\u010Damo, da potek nastavite na vrednost od 0 do 360 dni.\\nPredpomnilnik lahko po\\u010Distite, tako da pritisnete gumb Po\\u010Disti predpomnilnik paketov.\nT_EXPIRY=Pote\\u010De\\:\nT_DAYS=dni\nB_CLEANUP_CACHE=Po\\u010Disti predpomnilnik paketov\nM_CLEANUP_SUCCESS=Predpomnilnik zahtev je bil uspe\\u0161no po\\u010Di\\u0161\\u010Den\n',
